export default (function(a,b,c,d,e,f,g,h){return {data:{MFxoYdtjm1:{data:{id:366,attributes:{imdbId:"tt0090753",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzU0MTY0MmYtMDU2MC00ZTRjLThmODktMGY5ODAwNzc4NmI1XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"4.4\u002F10"},{Source:"Metacritic",Value:"18\u002F100"}],item_lang:{data:{id:1029,attributes:{title:b,plot:"Returning to the small Florida town where he grew up, Billy Turner (Nelson) learns that his father has been killed. With little help from the police, Billy will take matters into his own hands and go up against a ruthless local mob boss in a desperate search to find the killer.",slug:"blue-city"}}},books:{data:[{id:3276,attributes:{title:b,description:f,thumbnail:g,authors:[c],firstBook:true,published:h,publisher:e,subtitle:a}},{id:3277,attributes:{title:b,description:f,thumbnail:g,authors:[c],firstBook:d,published:h,publisher:e,subtitle:a}},{id:3278,attributes:{title:"The Blue Hammer",description:"The desert air is hot with sex and betrayal, death and madness and only Detective Lew Archer can make sense of a killer who makes murder a work of art. Finding a purloined portrait of a leggy blonde was supposed to be an easy paycheck for Archer, but that was before the bodies began piling up. Suddenly, Archer find himself smack in the middle of a decades-long mystery of a brilliant artist who walked into the desert and simply disappeared. He left behind a bevy of muses, molls, dolls, and dames-each one scrambling for what they thought was rightfully theirs.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yEuTjPHw5fUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2010-11-17",publisher:e,subtitle:a}},{id:3279,attributes:{title:b,description:a,thumbnail:a,authors:["Kenneth Millar"],firstBook:d,published:"1950-01-01",publisher:a,subtitle:a}},{id:3280,attributes:{title:"The Bearded Lady",description:"In this short story from Ross Macdonald’s The Archer Files, detective Lew Archer stops in town to look in on an old army buddy, an artist, only to find that he has mysteriously disappeared. Seemingly the only clue is a disturbing charcoal sketch of a woman with a thick beard sitting in his studio. As Archer finds himself drawn into the investigation, it soon becomes clear that things are not what they seem. And that no one is above suspicion. A Vintage Short.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=fhczEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2021-10-26",publisher:"Vintage",subtitle:"From The Archer Files"}}]}}},meta:{}}},prerenderedAt:1680940929189}}("","Blue City","Ross Macdonald",null,"Vintage Crime\u002FBlack Lizard","He was a son who hadn’t known his father very well. It was a town shaken by a grisly murder—his father’s murder. Johnny Weatherly was home from a war and wandering. When he found out that his father had been assassinated on a street corner and that his father’s seductive young wife had inherited a fortune, he started knocking on doors. The doors came open, and Johnny stepped into a world of gamblers, whores, drug-dealers, and blackmailers, a place in which his father had once moved freely. Now Johnny Weatherly was going to solve this murder—by pitting his rage, his courage, and his lost illusions against the brutal underworld that has overtaken his hometown.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=H2u3-P1AQSAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-01-11"))